import React, { useState } from "react";
import { render } from "react-dom";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";

const jurosSimples = () => {
  return (
  <>
    <form>
    <TextField label="Juros Anual Simples" variant="outlined" />
    <TextField label="Juros ao Mês Simples" variant="filled" />
    </form>
  </>
  );
};

const jurosCompostos = () => {
  return (
  <>
    <form>
    <TextField label="Juros Anual Composto" variant="outlined" />
    <TextField label="Juros ao Mês Composto" variant="filled" />
    </form>
  </>
  );
};

render(<jurosSimples />, document.querySelector("#root"));

